import React from 'react';
import { Link } from 'react-router-dom';

export default function Dashboard() {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <div className="text-center">
        <h1 className="text-4xl font-bold text-indigo-900">Welcome to Dashboard</h1>
        <p className="text-gray-700 mt-4">You are successfully logged in.</p>
        <Link to="/" className="text-indigo-700 hover:underline mt-6 inline-block">Logout</Link>
      </div>
    </div>
  );
}
